function get_page(host, pad) {
    function get_url(num) {
        // è¯·æ±‚é“¾æ¥è¿”å›çŠ¶æ€ç 
        let url = host + String(num).padStart(pad, '0') + '.jpg'
        return java.fetch(url, {}).code()
    }

    news = 1,old = 0, c1 = 0, c2 = 0, count = 0
    while (true) {
        count++
        if (count >= 12){
            return 'é”™è¯¯'
        }
        code = get_url(news)
        if (news === 1 && code === 404){
            return 'é”™è¯¯'
        }
        if (code === 200 && c1 === 0) {
            old = news
            news = news + 100
        } else if (code === 404) {
            if (get_url(news - 1) === 200) {
                s = news - 1
                break
            }
            c1 = Math.abs(Math.floor((news - old) / 2))
            c2 = news - old - c1 // å‡å»c1å‰©ä½™çš„
            news = news - c1
        }

        if (code === 200 && c1 !== 0) {
            if (get_url(news + 1) !== 200) {
                s = news
                break
            }
            c1 = Math.abs(Math.floor(c2 / 2))
            c2 = c2 - c1
           old = news
            news = news + c1
        }
    }

    let list = []
    for (let i=1; i<=s; i++){
        list.push(host + String(i).padStart(pad, '0') + '.jpg')
    }
    return list
}

